  false,\n\t\"url\": null,\n\t\"notes\": \"This report describes contemporary and
  recent historic use of fish and wildlife resources by residents of Northway, Alaska.
  Northway today consists primarily of an Athabaskan population which formerly lived
  and subsisted in the surrounding area, as well as some Alaska Natives from elsewhere
  in the state, and non-Natives who have moved to the community since the early 1940s.
  The discussion of resource use activities centers on land used, settlement patterns,
  and seasonality of activities. A brief history of the community and overview of
  current residence patterns are also included.\",\n\t\"license_title\": \"License
